package ccxt

type Coinspot struct {
	*coinspot
	Core          *coinspot
	exchangeTyped *ExchangeTyped
}

func NewCoinspot(userConfig map[string]interface{}) *Coinspot {
	p := &coinspot{}
	p.Init(userConfig)
	return &Coinspot{
		coinspot:      p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}

